import {useState} from 'react';
import './App.css';

function App() {
  const [count, setCount] = useState(0);
  return (
    <div className="App">
      <header className="App-header">
        <h3 data-testid="counter">{count}</h3>
        <button data-textid="minus-button">-</button>
        <button data-textid="plus-button">+</button>
      </header>
    </div>
  );
}

export default App;
